import React from 'react'
import { Menu, Layout } from 'antd';
import styled from 'styled-components'

const { Header } = Layout;

const StyledHeader = styled(Header)`
    display: flex;
    padding: 12px;
    padding-left: 20px;
    padding-right: 20px;
    height: 70px;
    width: 100%;
    background-color: rgba(0,0,0,0);
`;

const MenuLogoContainer = styled.div`
    display: flex;
    flex-direction: row;
    flex: 1;
    justify-content: space-between;
    width: 100%;
    align-items: center;
`;

const MenuStyled = styled(Menu)`
    display: flex;
    flex-direction: row;
    flex: 1;
    justify-content: flex-end;
`

const NavBarItem = styled(Menu.Item)`
    font-family: 'Benton Bold';
    &:focus {
        background-color: #FFCB05;
        border-radius: 5px;
    }
`

const Navbar: React.FC = () => {
    return (
        <StyledHeader>
            <MenuLogoContainer>
                <a href={'/'}>
                    <img height={40} src={require('../../assets/images/logo.png')} alt={"MasterSeats Logo"}/>
                </a>
                <MenuStyled>
                    <Menu.Item>
                        Home
                    </Menu.Item>
                    <Menu.Item>
                        Login
                    </Menu.Item>
                    <Menu.Item>
                        Sign Up
                    </Menu.Item>
                </MenuStyled>
            </MenuLogoContainer>
        </StyledHeader>
    )
}

export default Navbar
